define(["jquery","core/ajax","mod_supervideo/player_render"],function($,Ajax,PlayerRender){var modform={id_name:null,id_videourl:null,init:function(engine,lang,courseSection){modform.loadposter(lang);if(courseSection){modform.id_videourl.after(`
                    <div style="width:100%;">
                        <a id="kapture-open" class='btn btn-primary' 
                           href='${M.cfg.wwwroot}/mod/supervideo/vendor/kapture/?${courseSection}'>
                            ${M.util.get_string("record_kapture","supervideo")}   
                        </a>
                    </div>`);modform.id_name.focus(function(){var videotitle=modform.id_name.val();$("#kapture-open").attr("href",`${M.cfg.wwwroot}/mod/supervideo/vendor/kapture/?${courseSection}&videotitle=${videotitle}`)})}}};return modform});